                    //    startPosition: 'URLHash',

                    responsiveClass: true,
                    responsive: {
                        0: {
                            items: 1,
                            nav: true,
                            dots: false,
                        },
                        500: {
                            items: 2,
                            nav: true,
                            dots: false,
                        },
                        767: {
                            items: 2,
                            nav: true,
                            dots: false,
                        },
                        768: {
                            items: 2,
                            dots: true,
                        },
                        1000: {
                            items: 2,
                            dots: true,
                        },
                        1100: {
                            items: 2,
                            dots: false,
                        }
                    }
                });
                //checkClasses();
                //carousel.on('translated.owl.carousel', function(event) {
                //    checkClasses();
                //});
                function checkClasses() {

                    var total = $('#tabslider .owl-stage .owl-item.active').length;

                    $('#tabslider .owl-stage .owl-item').removeClass('firstActiveItem lastActiveItem');

                    $('#tabslider .owl-stage .owl-item.active').each(function (index) {
                        if (index === 0) {
                            // this is the first one
                            $(this).addClass('firstActiveItem');
                        }
                        if (index === total - 1 && total > 1) {
                            // this is the last one
                            $(this).addClass('lastActiveItem');
                        }

                    });
                }
                $('.secondary').on('click', function () {
                    //$('.owl-item').removeClass('active');

                    $('#tabslider .owl-stage .owl-item').removeClass('firstActiveItem lastActiveItem');
                    carousel.trigger('to.owl.carousel', [$(this).data('id')])
                    $('[data-hash=' + $(this).data('id') + ']').parent().addClass('firstActiveItem');
                    $('[data-hash=' + $(this).data('id') + ']').parent().next().addClass('lastActiveItem');
                });

                $('#tabslider .owl-stage .owl-item').removeClass('firstActiveItem lastActiveItem');
                carousel.trigger('to.owl.carousel', [0])
                $('[data-hash="0"]').parent().addClass('firstActiveItem');
                $('[data-hash="0"]').parent().next().addClass('lastActiveItem');
                $('.tab1').addClass('active');
            })
        </script>

